import React, { useState } from "react";

export default function Counter1() {
  const [counter, setCounter] = useState(0);
  return (
    <>
      <h1>{counter}</h1>
      <button onClick={() => setCounter(counter + 1)}>Increament</button>
    </>
  );
}
